import * as React from 'react';
import ReactMapGL from 'react-map-gl';

function App() {
  const [viewport, setViewport] = React.useState({
    latitude: 37.7577,
    longitude: -122.4376,
    zoom: 8
  });

  return (
    <div>
      <ReactMapGL
        {...viewport}
        mapboxApiAccessToken={process.env.REACT_APP_MAPBOX}
        width="100vh"
        height="100vh"
        onViewportChange={(viewport) => setViewport(viewport)}
      />
    </div>
  );
}

export default App;
